import {
	getPersonListSearch,
	queryTreeListByPid,
	getUseDept,
	updatePersonArchivesStatus,
	getStudyJudgesList,
	getPersonByIdCard,
	insertStudyJudge,
	getPersonArchivesList,
    getPersonArchivesReadStatus,
	queryCheckPersonList,
    updatePersonArchives,
	insertAlarmRecord,
	getPersonExpenseCalendarList
} from './service'
import { tableList, reportList } from '@/utils/utils'

const Model = {
	namespace: 'carDetails',
	state: {
		data: {
			list: [],
			page: {
				currentPage: 1,
				showCount: tableList
			}
		},
		useList: [],
		riskList: [],
		tables: {
			list: [],
			page: {
				currentPage: 1,
				showCount: reportList
			}
		},
		personInfor: {},
		information: [],
        waringInfor:[],
		socialsList: [],
        readStatus:{}
	},
	effects: {
		*getPersonListSearch({ payload, success }, { call, put }) {
			const response = yield call(getPersonListSearch, payload)
			yield put({
				type: 'personnelList',
				payload: response
			})
		},
		*policeQuery({ payload, success }, { call, put }) {
			const response = yield call(queryTreeListByPid, payload)
			yield put({
				type: 'riskList',
				payload: response
			})
		},
		*getUseDept({ payload, success }, { call, put }) {
			const response = yield call(getUseDept, payload)
			yield put({
				type: 'useDeptList',
				payload: response
			})
		},
		*updatePersonArchivesStatus({ payload, success }, { call, put }) {
			const response = yield call(updatePersonArchivesStatus, payload)
			if (response && success) {
				success(response)
			}
		},
		*getStudyJudgesList({ payload, success }, { call, put }) {
			const response = yield call(getStudyJudgesList, payload)
			yield put({
				type: 'tablesList',
				payload: response
			})
		},
		*getPersonExpenseCalendarList({ payload, success }, { call, put }) {
			const response = yield call(getPersonExpenseCalendarList, payload)
			yield put({
				type: 'tablesList',
				payload: response
			})
		},
		*getPersonByIdCard({ payload, success }, { call, put }) {
			const response = yield call(getPersonByIdCard, payload)
			yield put({
				type: 'personInfor',
				payload: response
			})
            if (response && success) {
				success(response)
			}
		},
        *getPersonArchivesReadStatus({ payload, success }, { call, put }) {
			const response = yield call(getPersonArchivesReadStatus, payload)
			yield put({
				type: 'readStatus',
				payload: response
			})
		},
		*insertStudyJudge({ payload, success }, { call, put }) {
			const response = yield call(insertStudyJudge, payload)
			if (response && success) {
				success(response)
			}
		},
		*insertAlarmRecord({ payload, success }, { call, put }) {
			const response = yield call(insertAlarmRecord, payload)
			if (response && success) {
				success(response)
			}
		},
		*queryCheckPersonList({ payload, success }, { call, put }) {
			const response = yield call(queryCheckPersonList, payload)
			yield put({
				type: 'tablesList',
				payload: { ...response,type: '1'}
			})
		},
        *updatePersonArchives({ payload, success }, { call, put }) {
			const response = yield call(updatePersonArchives, payload)
			if (response && success) {
				success(response)
			}
		},
		*getPersonArchivesList({ payload, success }, { call, put }) {
			const response = yield call(getPersonArchivesList, payload.data)
			if (payload.type == '1') {
				yield put({
					type: 'information',
					payload: response
				})
			}
            if(payload.lable == '1'){
                yield put({
					type: 'waringInfor',
					payload: response
				})
            }
			if (payload.type == '2') {
				yield put({
					type: 'socials',
					payload: response
				})
			}

		}
	},
	reducers: {
		personnelList(state, action) {
			let arr = {
				list: []
			}
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					arr = action.payload.result
				} else {
					arr = {
						list: [],
						page: {
							currentPage: 1,
							currentResult: 0,
							showCount: 10,
							totalPage: 1,
							totalResult: 0
						}
					}
				}
			}
			return { ...state, data: arr }
		},
		riskList(state, action) {
			return { ...state, riskList: action.payload.data }
		},
		useDeptList(state, action) {
			return { ...state, useList: action.payload.data }
		},
		information(state, action) {
			let arr = []
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					arr = action.payload.result.list
				}
			}
			return { ...state, information: arr }
		},
        waringInfor(state, action) {
			let arr = []
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					arr = action.payload.result.list
				}
			}
			return { ...state, waringInfor: arr }
		},
		socials(state, action) {
			let arr = [],
				items = []
			let datas = {}
            // if (action.payload.result) {
			// 	if (action.payload.result.reason.code == '200') {
			// 		arr = action.payload.result.list
			// 	}
			// }
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					console.log(action.payload.result.list)
					if (action.payload.result.list && action.payload.result.list.length) {
						console.log(1111, action.payload.result.list[0].archives_info)
						if (
							action.payload.result.list[0].archives_info &&
							action.payload.result.list[0].archives_info.length
						) {
							console.log(2222, action.payload.result.list[0].archives_info[0])
							datas = action.payload.result.list[0].archives_info[0]
							if (datas.tagx && datas.tagx.length) {
								let child = []

								for (let index = 0; index < datas.tagx.length; index++) {
									const element = datas.tagx[index]
									child.push({
										name: element.name,
										belong: '同案关系',
										imgs:
											'data:image/png;base64,'
									})
								}
								items.push({
									name: '同案关系',
									child: child,
									imgs:
										'data:image/png;base64,'
								})
							}
							if (datas.txgx && datas.txgx.length) {
								let child = []

								for (let index = 0; index < datas.txgx.length; index++) {
									const element = datas.txgx[index]
									child.push({
										name: element.name,
										belong: '同行关系',
										imgs:
											'data:image/png;base64,'
									})
								}
								items.push({
									name: '同行关系',
									child: child,
									imgs:
										'data:image/png;base64,'
								})
							}
							if (datas.tjgx && datas.tjgx.length) {
								let child = []

								for (let index = 0; index < datas.tjgx.length; index++) {
									const element = datas.tjgx[index]
									child.push({
										name: element.name,
										belong: '同监关系',
										imgs:
											'data:image/png;base64,'
									})
								}
								items.push({
									name: '同监关系',
									child: child,
									imgs:
										'data:image/png;base64,'
								})
							}
							if (datas.tzgx && datas.tzgx.length) {
								let child = []

								for (let index = 0; index < datas.tzgx.length; index++) {
									const element = datas.tzgx[index]
									child.push({
										name: element.name,
										belong: '同住关系',
										imgs:
											'data:image/png;base64,'
									})
								}
								items.push({
									name: '同住关系',
									child: child,
									imgs:
										'data:image/png;base64,'
								})
							}
							if (datas.tswgx && datas.tswgx.length) {
								let child = []

								for (let index = 0; index < datas.tswgx.length; index++) {
									const element = datas.tswgx[index]
									child.push({
										name: element.name,
										belong: '同上网关系',
										imgs:
											'data:image/png;base64,'
									})
								}
								items.push({
									name: '同上网关系',
									child: child,
									imgs:
										'data:image/png;base64,'
								})
							}
						}
					}
					arr.push({
						name: datas.name,
						child: items,
						imgs:
							'data:image/png;base64,'
					})
				}
			}
			return { ...state, socialsList: arr }
		},
        readStatus(state, action) {
			let arr = {}
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					arr = action.payload.result.readStatus
				}
			}
			return { ...state, readStatus: arr }
		},
		tablesList(state, action) {
			let arr = {
				list: []
			}
            console.log(action)
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
                    if(action.payload.type){
                        // action.payload.result.list.map(v => v.label_array = v.label_array.map(k => k = JSON.parse(k).name))
                   action.payload.result.list.map(v => v.label_array = v.label_array.map(k => k = {tag_name: JSON.parse(k).name,tag_color: JSON.parse(k).color}))
                    // arr = action.payload.result
                    }
					arr = action.payload.result
				} else {
					arr = {
						list: [],
						page: {
							currentPage: 1,
							currentResult: 0,
							showCount: 10,
							totalPage: 1,
							totalResult: 0
						}
					}
				}
			}
			return { ...state, tables: arr }
		},
		personInfor(state, action) {
			let arr = {}
			if (action.payload.result) {
				if (action.payload.result.reason.code == '200') {
					arr = action.payload.result.person
				}
			}
			return { ...state, personInfor: arr }
		}
	}
}
export default Model
